import React from 'react';

function CardAtleta({ atleta }) {
  return (
    <div className="card">
      <h3>{atleta.player_name}</h3>
      <p>Idade: {atleta.player_age}</p>
      <p>Time: {atleta.team_name}</p>
      <p>Posição: {atleta.player_type}</p>
    </div>
  );
}

export default CardAtleta;
